INSERT INTO OBJETIVO (IDOBJETIVO, TITULO, DESCRIPCION) VALUES (1, 'Fin de la pobreza', 'Poner fin a la pobreza en todas sus formas en todo el mundo');
INSERT INTO OBJETIVO (IDOBJETIVO, TITULO, DESCRIPCION) VALUES (2, 'Hambre cero', 'Poner fin al hambre, lograr la seguridad alimentaria y la mejora de la nutrición y promover la agricultura sostenible');
INSERT INTO OBJETIVO (IDOBJETIVO, TITULO, DESCRIPCION) VALUES (3, 'Salud y bienestar', 'Garantizar una vida sana y promover el bienestar para todos en todas las edades');
INSERT INTO OBJETIVO (IDOBJETIVO, TITULO, DESCRIPCION) VALUES (4, 'Educación de calidad', 'Garantizar una educación inclusiva, equitativa y de calidad y promover oportunidades de aprendizaje durante toda la vida para todos');
INSERT INTO OBJETIVO (IDOBJETIVO, TITULO, DESCRIPCION) VALUES (5, 'Igualdad de género', 'Lograr la igualdad entre los géneros y empoderar a todas las mujeres y las niñas');
INSERT INTO OBJETIVO (IDOBJETIVO, TITULO, DESCRIPCION) VALUES (6, 'Agua limpia y saneamiento', 'Garantizar la disponibilidad de agua y su gestión sostenible y el saneamiento para todos');
INSERT INTO OBJETIVO (IDOBJETIVO, TITULO, DESCRIPCION) VALUES (7, 'Energía asequible y no contaminante', 'Garantizar el acceso a una energía asequible, segura, sostenible y moderna para todos');
INSERT INTO OBJETIVO (IDOBJETIVO, TITULO, DESCRIPCION) VALUES (8, 'Trabajo decente y crecimiento económico', 'Promover el crecimiento económico sostenido, inclusivo y sostenible, el empleo pleno y productivo y el trabajo decente para todos');
INSERT INTO OBJETIVO (IDOBJETIVO, TITULO, DESCRIPCION) VALUES (9, 'Industria, innovación e infraestructura', 'Construir infraestructuras resilientes, promover la industrialización inclusiva y sostenible y fomentar la innovación');
INSERT INTO OBJETIVO (IDOBJETIVO, TITULO, DESCRIPCION) VALUES (10, 'Resolución de las desigualdades', 'Reducir la desigualdad en y entre los países');
